import React from "react";
import { Calendario } from "./style";


function OrganizarSemana(diaSemana: any) {
  let domingo:any = [];
  for (let i = 0; i <= diaSemana.length; i++) {
    domingo[i] = <li>{diaSemana[i]}</li>;

  }
  return domingo;
}

function Card(dias: any) {
  let domingo:any;
  domingo = OrganizarSemana(dias.dias.domingo);

  console.log(domingo);

  return (
    <>
      <Calendario>
        {domingo}
      </Calendario>
    </>
  );


}

export default Card;
